const Module = () => {
    const [form,setForm] = useState({
        name:"",
        age:""
    })
    const handleChange=(e)=>{
        setForm({...form,[e.target.name]:e.target.value})
    }
    const handleSubmit=()=>{
        alert("Form Submitted Successfully")
        setForm({
            name:"",
            age:''
        });
    }
  return (
    <>
    </>

    
  )
}

export default Module
